import React, { useState } from "react";
import {Nav} from "react-bootstrap";

const SideBar = props => {
   
    const [show, setShow] = useState("d-none");
    const [change, setChange] = useState("");

    const handleClick = () => {
        setShow("vw-100");
        setChange("d-none");
    }

    return (
        <>
    
            <Nav className={`col-2 vh-100  d-md-block bg-light sidebar`}
            activeKey="/home"
            onSelect={selectedKey => alert(`selected ${selectedKey}`)}
            >
                <div className="sidebar-sticky">это че</div>
            <Nav.Item className="border-bottom border-top">
                <Nav.Link href="/home">Active</Nav.Link>
            </Nav.Item>
            <Nav.Item className="border-bottom">
                <Nav.Link eventKey="link-1">Все пользователи</Nav.Link>
            </Nav.Item>
            <Nav.Item className="border-bottom">
                <Nav.Link  eventKey="link-2">Все записи</Nav.Link>
            </Nav.Item>
            <Nav.Item className="border-bottom">
                <Nav.Link eventKey="link-3">Записать пользователя</Nav.Link>
            </Nav.Item>
            <Nav.Item className="border-bottom">
                <Nav.Link eventKey="disabled" disabled>
                Disabled
                </Nav.Link>
            </Nav.Item>
            </Nav>
          
        </>
        );
  };
  export default SideBar;
